import React from "react";
import Team from "../shared/TeamCard"; // Importing the Team component
import "./about.css"; // Main About Page styles

const About = () => {
  return (
    <div className="about">
      {/* Header Section */}
      <section className="about__header">
        <div className="about__header-text">
          <h1>
            Travel agency wants to offer you the best experiences and memories
            of your life!
          </h1>
          <p>
            Our team has only one goal: to create memorable moments for our
            travelers. "People forget years and remember moments."
          </p>
        </div>
      </section>

      {/* Image Section */}
      <section className="about__image">
        <img
          src="https://via.placeholder.com/1200x600" // Replace with your desired image URL
          alt="Desert Landscape"
        />
      </section>

      {/* Team Section */}
      <section className="about__team">
        <h2>Our Team</h2>
        <p>"People forget years and remember moments"</p>
        <Team />
      </section>
    </div>
  );
};

export default About;
